import './LoginForm.css';

function LoginForm() {
    return (
        <form className='container login-form'>
            <h1 className='login-form__heading'>Login</h1>
            <input 
                className='login-form__input' 
                type='text'
                placeholder='Login'>
            </input>
            <input 
                className='login-form__input' 
                type='password'
                placeholder='Password'>
            </input>
        </form>
    ); 
}

export default LoginForm;
